# 2. Structured I/O Analysis of Compressible Flows 

Consider a compressible fluid in the domain $\Gamma \subset \mathbb{R}^{3}$. The state of the fluid at any instant in time can be characterized solely based on the primitive variables of density $\xi(\mathbf{x}, t)$, velocity $\hat{\mathbf{u}}(\mathbf{x}, t)=(\hat{a}(\mathbf{x}, t), \hat{v}(\mathbf{x}, t), \hat{w}(\mathbf{x}, t))$, and pressure $\hat{p}(\mathbf{x}, t)$. Here, $\mathbf{x} \in \Gamma$ is the spatial coordinate and $t \in \mathbb{R}_{\geqslant 0}$ is time. The equations of motion governing the dynamics of the flow in $\Gamma$ are derived from the conservation laws for mass, momentum, and energy. These equations can be expressed in terms of the primitive variables $\hat{\mathbf{q}}=(\hat{\xi}:=1 / \xi, \hat{\mathbf{u}}, \hat{p})$. All variables are non-dimensionalized in the usual way using $L, u_{r}, T_{r}, \xi_{r}=1 / \rho_{r}$, and $\eta_{r}$ as the reference length, velocity, temperature, specific volume (density), and viscosity, respectively. Using the dimensional equation of state, the reference pressure is chosen to be $p_{r}=T_{r} R / \xi_{r}$, where $R$ denotes the gas constant. Denoting all dimensional quantities with a superscript $(\cdot)^{d}$, we define the following non-dimensional quantities:

$$
\begin{aligned}
\xi & =\frac{\xi^{d}}{\xi_{r}}, \quad \hat{\mathbf{u}}=\frac{\hat{\mathbf{u}}^{d}}{u_{r}}, \quad t=\frac{t^{d}}{L / u_{r}}, \quad \hat{\eta}=\frac{\hat{\eta}^{d}}{\eta_{r}}, \quad \hat{T}=\frac{\hat{T}^{d}}{T_{r}}, \quad \hat{p}=\frac{\hat{p}^{d}}{p_{r}} \\
R e & =\frac{u_{r} L}{\eta_{r} \xi_{r}}, \quad M_{r}=\frac{u_{r}}{a_{r}}=\frac{u_{r}}{\sqrt{\gamma R T_{r}}}
\end{aligned}
$$

where $\eta$ is the coefficient of shear viscosity and $\gamma$ is the specific heat ratio, while $R e$ and $M_{r}$ denote the Reynolds number and Mach number, respectively. The resulting non-dimensional compressible NSE can be expressed as

$$
\begin{aligned}
\partial_{t} \hat{\xi}+\hat{\mathbf{u}} \cdot \nabla \xi-\hat{\xi} \nabla \cdot \hat{\mathbf{u}} & =0 \\
\partial_{t} \hat{\mathbf{u}}+\hat{\mathbf{u}} \cdot \nabla \hat{\mathbf{u}}+\frac{1}{\gamma M_{r}^{2}} \hat{\xi} \nabla \hat{p}-\frac{1}{R e} \hat{\xi} \nabla \cdot \Pi(\hat{\mathbf{u}}, \hat{\eta}) & =0 \\
\partial_{t} \hat{p}+\hat{\mathbf{u}} \cdot \nabla \hat{p}+\gamma \hat{p} \nabla \cdot \hat{\mathbf{u}}-\frac{\gamma(\gamma-1) M_{r}^{2}}{R e} \Phi(\hat{\mathbf{u}}, \hat{\eta})-\frac{\gamma}{R e P r} \nabla \cdot(\hat{\eta} \nabla(\hat{p} \hat{\xi})) & =0
\end{aligned}
$$

with the associated non-dimensional equation of state for a perfect polytropic gas $\hat{p} \xi=\hat{T}$. Here, $\operatorname{Pr}$ is the Prandtl number and $\Pi(\hat{\mathbf{u}}, \hat{\eta})$ denotes the viscous stress tensor, which for a Newtonian fluid takes the form

$$
\Pi(\hat{\mathbf{u}}, \hat{\eta})=\left[\begin{array}{lll}
\tau_{x x} & \tau_{x y} & \tau_{x z} \\
\tau_{y x} & \tau_{y y} & \tau_{y z} \\
\tau_{z x} & \tau_{z y} & \tau_{z z}
\end{array}\right]=2 \hat{\eta} \mathcal{D}+\left(\hat{\eta}_{b}-\frac{2}{3} \hat{\eta}\right)(\nabla \cdot \hat{\mathbf{u}}) \mathbf{I}_{3}
$$

where $\tilde{\eta}_{b}$ is the coefficient of bulk viscosity, and $\mathcal{D}$ is the deformation tensor given by

$$
\mathcal{D}=\left[\begin{array}{ccc}
\partial_{x} \tilde{u} & \frac{1}{2}\left(\partial_{x} \tilde{v}+\partial_{y} \tilde{u}\right) & \frac{1}{2}\left(\partial_{x} \tilde{w}+\partial_{z} \tilde{u}\right) \\
\frac{1}{2}\left(\partial_{y} \tilde{u}+\partial_{x} \tilde{v}\right) & \partial_{y} \tilde{v} & \frac{1}{2}\left(\partial_{y} \tilde{w}+\partial_{z} \tilde{v}\right) \\
\frac{1}{2}\left(\partial_{z} \tilde{u}+\partial_{x} \tilde{w}\right) & \frac{1}{2}\left(\partial_{z} \tilde{v}+\partial_{y} \tilde{w}\right) & \partial_{z} \tilde{w}
\end{array}\right]
$$

In this work, we will apply Stokes' hypothesis, so that $\tilde{\eta}_{b}=0$. Also, the term $\Phi(\tilde{\mathbf{u}}, \tilde{\eta})$ in (2.3) is the viscous dissipation term given by

$$
\begin{aligned}
\Phi(\tilde{\mathbf{u}}, \tilde{\eta})= & \tilde{\eta}\left(2\left(\left(\partial_{x} \tilde{u}\right)^{2}+\left(\partial_{y} \tilde{v}\right)^{2}+\left(\partial_{z} \tilde{w}\right)^{2}\right)+\left(\partial_{y} \tilde{u}+\partial_{x} \tilde{v}\right)^{2}+\left(\partial_{z} \tilde{v}+\partial_{y} \tilde{w}\right)^{2}+\left(\partial_{z} \tilde{u}+\partial_{x} \tilde{w}\right)^{2}\right) \\
& -\frac{2}{3} \tilde{\eta}(\nabla \cdot \tilde{\mathbf{u}})^{2} \\
= & \frac{\tilde{\eta}}{2}\left[\nabla \tilde{\mathbf{u}}+(\nabla \tilde{\mathbf{u}})^{\mathrm{T}}\right]^{2}-\frac{2}{3} \tilde{\eta}(\nabla \cdot \tilde{\mathbf{u}})^{2}
\end{aligned}
$$

# 3.3. Code Validation: Eigenvalues of $\hat{\mathbf{L}}\left(k_{x}, k_{z}\right)$ 

The eigenvalue spectrum obtained through our numerical implementation is shown in Fig. 3. The ' Y ' shape of the eigenvalues in Fig. 3b are consistent with the existing literature (Dawson \& McKeon 2019; Duck et al. 1994; Malik et al. 2006; Hu \& Zhong 1998). Note that these eigenvalues are associated with the viscous eigenmodes, i.e., modes that arise due to the viscous terms in the momentum and energy equations (Duck et al. 1994). In addition, the distribution of the eigenvalues depicted in Fig. 3a away from the imaginary axis is also expected (see, for example, similar trends reported in Malik et al. (2006)). These eigenvalues belong to the inviscid or acoustic eigenmodes (Dawson \& McKeon 2019; Duck et al. 1994;

Malik et al. 2006). We note that the viscous perturbations about the base flow do not have significant influence on the eigenvalues of the linear operator, as depicted in the comparison plots in Fig. 3. Therefore, conclusions drawn from classical stability analysis based on eigenvalues of the linear operator would be independent of the viscosity perturbations.
